import React from "react";
import { Menu } from "semantic-ui-react";
import { Link } from 'react-router-dom';

const NavBar = () => {
  return (
    <Menu secondary pointing>
      <Menu.Item as={Link}>Dashboard</Menu.Item>
      <Menu.Menu position="right" />
    </Menu>
  );
};

export default NavBar;
